import Menu from "./Menu";
const LoginAuth = () => {
  const { loginWithRedirect } = useAuth0();
  const { user, isAuthenticated, isLoading } = useAuth0();
  const { logout } = useAuth0();
  return (
    <>
      {isAuthenticated ? (
        <button
          onClick={() => {
            logout();
          }}
        >
          log out
        </button>
      ) : (
        <button
          onClick={() => {
            loginWithRedirect();
          }}
        >
          LoginAuth
        </button>
      )}
      {
        isAuthenticated && <Menu nickname={user.name}></Menu>
